DELIMITER $$
CREATE TRIGGER `update_progress` AFTER INSERT ON `marks` FOR EACH ROW BEGIN
    DECLARE student_id INT;
    DECLARE subject_id INT;
    DECLARE marks_count INT;
    DECLARE average_mark DECIMAL(5,2);
    
    SET student_id = NEW.StudentId;
    SET subject_id = NEW.subjectId;
    
    SELECT COUNT(mark) INTO marks_count FROM Marks WHERE studentId = student_id AND subjectId = subject_id;
    SELECT AVG(mark) INTO average_mark FROM Marks WHERE studentId = student_id AND subjectId = subject_id;
    
    IF EXISTS(SELECT * FROM Progress WHERE studentId = student_id AND subjectId = subject_id) THEN
        UPDATE Progress SET MarksCount = marks_count, AverageMark = average_mark WHERE studentId = student_id AND subjectId = subject_id;
    ELSE
        INSERT INTO Progress (studentId, subjectId, MarksCount, AverageMark) VALUES (student_id, subject_id, marks_count, average_mark);
    END IF;
END
$$
DELIMITER ;

